import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './DisposeMenu.css';
import 'react-toastify/dist/ReactToastify.css';

const AdminDashboard = () => {
    const navigate = useNavigate();
    const [usersData, setUsersData] = useState(null); // State to hold the fetched data

    const items = [
        { name: 'Computers', image: 'logo192.png' },
        { name: 'IC Computers', image: 'logo192.png' },
        { name: 'Laptops', image: 'logo192.png' },
        { name: 'Mobile Phones', image: 'logo192.png' },
        { name: 'Large Items', image: 'logo192.png' },
        { name: 'Small Items', image: 'logo192.png' },
    ];

    const handleClick = (item) => {
        if (item.name === 'Computers') {
            navigate('/computers'); // Navigate to '/computers' route when Computers item is clicked
        }
    };

    return (
        <div className="dispose-menu-container">
            <h2>Choose a Category</h2><br/><br/>
            <div className="dispose-items">
                {items.map((item, index) => (
                    <div key={index} className="dispose-item" onClick={() => handleClick(item)}>
                        <img src={process.env.PUBLIC_URL + '/' + item.image} alt={item.name} />
                        <p>{item.name}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default AdminDashboard;
